import { DropdownButton } from 'react-bootstrap';
import Dropdown from 'react-bootstrap/Dropdown';
import { avalibleNumber } from '../types/avalibleNumberType';
import { useState } from 'react';
import { User } from '../types/userType';
import { Organisation } from '../types/organisationType';

interface CustomDropdownProps {
  numbers?: avalibleNumber[];
  orgs?: string[];
  selectedValue?: number | string;
}


const CustomDropdown: React.FC<CustomDropdownProps> = ({ numbers, selectedValue, orgs }) => {
  const [selected, setSelected] = useState<number | string>();

  function handleSelect(value: number | string){
    setSelected(value);
  }

  return (
    <>
      {numbers && (<DropdownButton id="dropdown-basic-button" title={selected != undefined? `${selected}` : "Seleccionar"}>
        {numbers.map((number, index) => (
          <Dropdown.Item key={index} onClick={() => handleSelect(number.idAvalibleNumber)} >{number.idAvalibleNumber}</Dropdown.Item>
        ))}
      </DropdownButton>)}
      {orgs && (<DropdownButton id="dropdown-basic-button" title={selected != undefined? `${selected}` : "Seleccionar"}>
        {orgs.map((org, index) => (
          <Dropdown.Item key={index} onClick={() => handleSelect(org)} >{org}</Dropdown.Item>
        ))}
      </DropdownButton>)}
    </>
  );
}

export default CustomDropdown;
